import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";

const { client } = vendiaClient();


export const DevicePage = () => {
    
    const[filteredTestList, setFilteredTestList] = useState();

    useEffect(() => {
        const filteredTestList = async () => {
            const testList = await client.entities.test.list();
            console.log(testList?.items);
            setFilteredTestList(testList?.filter(testList => testList.Device.includes('Device1')));
        }
        listTest();
    }, [])
    

    /*
    {names.filter(name => name.includes('J')).map(filteredName => (
        <li>
          {filteredName}
        </li>
      ))}
    */
    return(
        
        <div className="DevicePage">
            <h1> Device 1 </h1>

            <div>
                {filteredtestList?.map((item, index) => (
                    <li key={index}>   
                    {item.Device}
                    </li>
                ))}
            </div>

        </div>

    )
}
